import React from "react";

const Cell = ({ value, onClick }) => {
  // object destructuring
  // const { value, onClick} = props;
  // console.log(value, onClick);
  return (
    <div className="game-cell" onClick={props.onClick}>
      {props.value}
    </div>
  );
};

export default Cell;
